import React from "react";

export const Form = () => {


    return (
        <form className="form" id="form" action="#">
            <div class="mb-3">
                <label for="" class="form-label">Nome</label>
                <input
                    type="text"
                    class="form-control"
                    name="name"
                    id="name"
                    placeholder="es: Mario"
                />
            </div>

        </form>
    );
}
